import './App.css';

// App.js


import { BrowserRouter as Router, Route, Switch, Routes } from 'react-router-dom';
import Home from 'C:\Projects\personal project\my-react-app\src\components\Home';
import Navbar from './components/Navbar';  // You might have a Navbar component
import React from 'react';


function App() {
  return (
    <Router>
          <Routes>
          {/* Home/Index Route */}
          <Route path="/" element={<Home />} />

          {/* Add more routes for other pages/components */}
          {/* <Route path="/about" element={<About />} /> */}
          {/* <Route path="/contact" element={<Contact />} /> */}

          {/* Handle 404 - Page Not Found */}
          <Route path="*" element={<NotFound />} />
        </Routes>
    </Router>
  );
}

// A simple NotFound component for handling 404 errors
function NotFound() {
  return (
    <div>
      <h1>404 - Not Found</h1>
      {/* You can add a link to navigate back to the home page or another page */}
    </div>
  );
}

export default App;
